import os
import json
import base64
import hashlib
import requests
from Crypto.Cipher import AES, PKCS1_OAEP
from Crypto.Util.Padding import unpad
from Crypto.PublicKey import RSA
from datetime import datetime

# Configuration des URLs
METADATA_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/IPToP_1.4.py_encrypted.metadata.json"
HASH_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/IPToP_1.4.py_encrypted.sha256"
SCRIPT_URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/main/IPToP_1.4.py_encrypted_ready_to_use.py"
SCRIPT_BASE_NAME = "IPToP_1.4url.py_encrypted"

def decrypt_data(encrypted_data, key):
    try:
        encrypted_data = base64.b64decode(encrypted_data)
        iv, ct = encrypted_data[:16], encrypted_data[16:]
        cipher = AES.new(key, AES.MODE_CBC, iv)
        return unpad(cipher.decrypt(ct), AES.block_size).decode()
    except Exception as e:
        print(f"Erreur de déchiffrement: {e}")
        return None

def decrypt_key_with_rsa(encrypted_key, private_key):
    return PKCS1_OAEP.new(private_key).decrypt(base64.b64decode(encrypted_key))

def check_for_updates():
    try:
        response = requests.get(METADATA_URL)
        if response.status_code == 200:
            remote_meta = response.json()
            with open(f"{SCRIPT_BASE_NAME}.metadata.json") as f:
                local_meta = json.load(f)
            if remote_meta["version"] > local_meta["version"]:
                print(f"Nouvelle version {remote_meta['version']} disponible")
                return True
    except Exception as e:
        print(f"Erreur vérification MAJ: {e}")
    return False

def update_script():
    try:
        for url, filename in [
            (METADATA_URL, f"{SCRIPT_BASE_NAME}.metadata.json"),
            (HASH_URL, f"{SCRIPT_BASE_NAME}.sha256"),
            (SCRIPT_URL, f"{SCRIPT_BASE_NAME}_ready_to_use.py")
        ]:
            response = requests.get(url)
            if response.status_code == 200:
                with open(filename, 'wb') as f:
                    f.write(response.content)
        print("Mise à jour réussie")
        return True
    except Exception as e:
        print(f"Erreur MAJ script: {e}")
        return False

# Point d'entrée principal
if __name__ == "__main__":
    if check_for_updates():
        update_script()
    
    try:
        with open(f"{SCRIPT_BASE_NAME}.metadata.json") as f:
            metadata = json.load(f)
        
        with open("private_key.pem") as f:
            private_key = RSA.import_key(f.read())
        
        decrypted_script = decrypt_data(
            """""",
            decrypt_key_with_rsa(metadata["encrypted_key"], private_key)
        )
        
        if decrypted_script:
            if datetime.now() > datetime.strptime(metadata["expiration_date"], "%Y-%m-%d"):
                print("Script expiré")
            else:
                exec(decrypted_script)
    except Exception as e:
        print(f"Erreur d'exécution: {e}")
